def score_to_letter(score):    if score > 93:        return 'A'    elif 90 <= score <= 93:        return 'A-'    elif 87 <= score < 90:        return 'B+'    elif 83 <= score < 87:        return 'B'    elif 80 <= score < 83:        return 'B-'    elif 77 <= score < 80:        return 'C+'    elif 73 <= score < 77:        return 'C'    elif 70 <= score < 73:        return 'C-'    elif 67 <= score < 70:        return 'D+'    elif 63 <= score < 67:        return 'D'    elif 60 <= score < 63:        return 'D-'    else:         return 'F'        score = int(input('What is your score?'))    print (score_to_letter(score))